When you mark a code snippet as executable via the +exec flag, you may not be interested in showing all the lines to your audience, as some of them may not be necessary to convey your point. For example, you may want to hide imports, non-essential functions, initialization of certain variables, etc. For this purpose, presenterm supports a prefix under certain programming languages that let you indicate a line should be executed when running the code but should not be displayed in the presentation. For example, in the following code snippet only the print statement will be displayed but the entire snippet will be ran: ```rust
# fn main() {
println!("Hello world!");
# }
``` Rather than blindly relying on a prefix that may have a meaning in a language, prefixes are chosen on a per language basis. The languages that are supported and their prefix is: rust: # . python/bash/fish/shell/zsh/kotlin/java/javascript/typescript/c/c++/go: /// . This means that any line in a rust code snippet that starts with # will be hidden, whereas all lines in, say, a golang code snippet that starts with a /// will be hidden.
